To see why the string t10 t35 t8 t36 cannot be generated:

1.  Record which nonterminals produce each single terminal:
   position 1: t10  → {NT63}
   position 2: t35  → {NT4, NT90}
   position 3: t8   → {NT87}
   position 4: t36  → {NT42}

2.  Try to build longer spans via binary rules (CYK).  No pair of these nonterminals matches the RHS of any binary rule, so no substring of length 2 or more can be built.

3.  In particular, S → NT71 NT73 could only succeed if NT71 generated the first part (t10 …) and NT73 the rest, but NT71 only ever yields ‘t48’, not t10.

Therefore the grammar cannot generate t10 t35 t8 t36.  
No

We build the CYK‐style table.  First, for each position i we list the nonterminals that directly generate the terminal at i:

1: t24 → {NT73}  
2: t24 → {NT73}  
3: t2  → {NT54, NT63}  
4: t24 → {NT73}  
5: t10 → {NT63}  
6: t39 → {NT21}  
7: t46 → {NT42}

The only binary productions are

 S  → NT71 NT73  
 NT73 → NT63 NT42  
 NT27 → NT54 NT4  
 NT42 → NT36 NT27  
 NT54 → NT21 NT87  
 NT36 → NT90 NT33  

When you try to fill length = 2 spans by pairing the above length = 1 sets, none of the required pairs (e.g. NT63 NT42 to make NT73, or NT21 NT87 to make NT54, etc.) ever appears, so every length = 2 cell is empty—and hence all longer spans remain empty.  In particular, there is never any NT71 (it would require t48), so you cannot get S → NT71 NT73 over the whole 7‐token input.  Therefore the grammar does not generate the string.  

No
